import React, {Component} from 'react';


class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: 'data:image/jpeg;base64,'};
    }

    render() {
        let that = this

        let attrs = {
            onChange(event) {
                event.preventDefault();
                that.forceUpdate();
                that.setState({

                    data: event.target.value
                })

            }
        };

        return (
            <div onKeyUp={this.onChange}>
                <img src={this.state.data} alt="" style={{height:300, width:450, marginLeft:"50%", transform: "translateX(-50%)"}}/>

                <pre style={{ marginLeft:"50%", transform: "translateX(-50%)"}}>&lt;img src="data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAASABIAAD/4QB0RXhpZgAATU....</pre>
            <textarea
                {...attrs}
                name="Data"
                style={{height:300, width:450, marginLeft:"50%", transform: "translateX(-50%)"}}
                value={this.props.text}>
                {this.state.data}
                </textarea>
            </div>
        )
    }

}
export default App

